'),(14,'It is a superimposition of ‘ㄹ’ and ‘ㅌ’. It is used only as a final consonant, not as an initial consonant.',0,1,0,'ㄾ',' 리을티읕[riωlthiωt]'),(15,'It is a superimposition of ‘ㄹ’ and ‘ㅍ’. It is used only as a final consonant, not as an initial consonant.',0,1,0,'ㄿ',' 리을피읖[riωlphiωp]'),(16,'It is a superimposition of ‘ㄹ’ and ㅎ’. It is used only as a final consonant, not as an initial consonant.',0,1,0,'ㅀ',' 리을히읗[riωlthiiωt]'),(17,'It is the fifth letter of the Hangul consonants. It is modeled after the shape of the mouth.',1,1,0,'ㅁ','미음[miωm]'),(18,'It is the sixth consonant of the Hangul consonants. It was created by adding strokes to the ‘ㅁ’.',1,1,0,'ㅂ','비읍[piωp]'),(19,'It is a superimposition of ‘ㅂ’ and ‘ㅅ’. It is used only as a final consonant, not as an initial consonant.',0,1,0,'ㅄ','비읍시옷[piωpʃiot]'),(20,'It is a superimposition of the letter \'ㅂ\' in Hangul. It is used only as the initial consonant and not as the final consonant. ',1,0,0,'ㅃ','쌍비읍[s\'aŋbiωp]'),(21,'It is the seventh letter of the Hangul consonants. It is modeled after the shape of a tooth.',1,1,0,'ㅅ','시옷[ʃiot]'),(22,'It is a superimposition of the letter \'ㅅ\' in Hangul.',1,1,0,'ㅆ','쌍시옷[s\'aŋʃiot]'),(23,'It is the eighth letter of the Hangul consonants. It was modeled after the shape of the throat.',1,1,0,'ㅇ','이응[iωŋ]'),(24,'It is the ninth letter of the Hangul consonants. It was made by adding a stroke to the letter \'ㅅ\'.',1,1,0,'ㅈ','지읒[tʃiωt]'),(25,'It is a superimposed \'ㅈ\' in the Hangul letter. It is used only as the first sound and not as the last sound.',1,0,0,'ㅉ','쌍지읒[ s\'aŋʤiωt]'),(26,'It is the tenth letter of the Hangul consonants. A stroke was added to the \'ㅅ\' to make a \'ㅈ\', and then another stroke was added to it. ',1,1,0,'ㅊ','치읓[tʃhiωt]'),(27,'It is the 11th letter of the Hangul consonants. It was made by adding strokes to the letter ‘ㄱ’, which resembles the shape of the tongue blocking the throat.',1,1,0,'ㅋ','키읔[khiωk]'),(28,'It is the 12th letter of the Hangul consonant. 